import small from '../images/main_small.png'
import big from  '../images/main_large.png'
const Nav =({minimal,authToken,setS})=>{

    return (
        <nav>
            <div className="logo-container">
                <img className="logo" src={minimal ? small : big}
                style={{ width: '200px', height: 'auto' }}/>

                {!authToken && !minimal &&<button className='nav-button primary-button login-button'>Log in</button>}
            </div>
        </nav>
    )
}
export default Nav
